    "periods_v1_tooltip": {                           "en": "Idle periods version 1, as shown in the old E3/DC portal. Does not support more than one period on the same day.", "de": "Die Version 1 der Sperrzeiten, so wie sie im alten E3/DC-Portal zu sehen sind. Damit ist nur eine Sperrzeit pro Tag möglich.", "ru": "Периоды простаивания версии 1, как показано на старом портале E3/DC. Не поддерживает более одного периода в тот же день.", "pt": "Períodos ociosos Versão 1, conforme mostrado no antigo portal E3/DC. Não suporta mais de um período no mesmo dia.", "nl": "Idle perioden versie 1, zoals weergegeven in het oude E3/DC -portal. Ondersteunt niet meer dan één periode op dezelfde dag.", "fr": "Périodes d'inactivité version 1, comme indiqué dans l'ancien portail E3 / DC. Ne prend pas en charge plus d'une période le même jour.", "it": "Periodi inattivi versione 1, come mostrato nel vecchio portale E3/DC. Non supporta più di un periodo lo stesso giorno.", "es": "Períodos de inactividad versión 1, como se muestra en el antiguo portal E3/DC. No admite más de un período el mismo día.", "pl": "Okresy bezczynności Wersja 1, jak pokazano w starym portalu E3/DC. Nie obsługuje więcej niż jednego okresu tego samego dnia.", "uk": "Періоди простою версії 1, як показано на старому порталі E3/DC. Не підтримує більше одного періоду в той же день.", "zh-cn": "空闲时期1版，如旧的E3/DC门户网站所示。在同一天不支持超过一个时期。"},
    "periods_v1v2": {                                 "en": "V1 and V2 interfere - not recommended!",           "de": "V1 und V2 beeinflussen sich gegenseitig - nicht empfohlen!", "ru": "Рекомендуется использовать только одну из версий простоя, потому что они взаимно влияют друг на друга нетривиальным образом.", "pt": "Recomenda-se usar apenas uma das versões do período ocioso, porque elas se afetam mutuamente de maneira não trivial.", "nl": "Het wordt aanbevolen om slechts één van de versies in de inactieve periode te gebruiken, omdat ze elkaar op een niet-triviale manier wederzijds beïnvloeden.", "fr": "Il est recommandé d'utiliser une seule des versions de la période d'inactivité, car elles s'infiltrent mutuellement de manière non triviale.", "it": "Si consiglia di utilizzare solo una delle versioni del periodo inattivo, perché si influenzano reciprocamente in modo non banale.", "es": "Se recomienda usar solo una de las versiones del período inactivo, ya que se afectan mutuamente entre sí de manera no trivial.", "pl": "Zaleca się stosowanie tylko jednej z wersji okresu bezczynności, ponieważ wzajemnie wpływają na siebie w sposób nietrywialny.", "uk": "Рекомендується використовувати лише одну з версій холостого періоду, оскільки вони взаємно впливають один на одного нетривіальним способом.", "zh-cn": "建议仅使用一个空闲时期版本之一，因为它们以非平凡的方式相互影响。"},
    "periods_v2": {                                   "en": "Idle periods version 2",                           "de": "Sperrzeiten Version 2",                            "ru": "Периоды холостого хода версии 2",                  "pt": "Períodos ociosos Versão 2",                        "nl": "Idle perioden versie 2",                           "fr": "Périodes d'inactivité version 2",                  "it": "Periodi inattivi versione 2",                      "es": "PERÍODOS DE IDLA Versión 2",                       "pl": "Idle Okresy Wersja 2",                             "uk": "Періоди простою версії 2",                         "zh-cn": "空闲时期2版2"},
    "periods_v2_tooltip": {                           "en": "In 2024, idle periods version 2 were introduced, as shown in the new E3/DC portal. Multiple periods on the same day are possible.", "de": "Im Jahr 2024 wurde die Version 2 der Sperrzeiten eingeführt, so wie sie im neuen E3/DC-Portal zu sehen sind. Damit sind mehrere Sperrzeiten an einem Tag möglich.", "ru": "В 2024 году были введены периоды простоя 2 версии 2, как показано на новом портале E3/DC. Возможны несколько периодов в один и тот же день.", "pt": "Em 2024, foram introduzidos períodos de marcha lenta 2, conforme mostrado no novo portal E3/DC. Vários períodos no mesmo dia são possíveis.", "nl": "In 2024 werden versie 2 van stationaire periodes geïntroduceerd, zoals weergegeven in de nieuwe E3/DC -portal. Meerdere periodes op dezelfde dag zijn mogelijk.", "fr": "En 2024, les périodes d'inactivité version 2 ont été introduites, comme le montre le nouveau portail E3 / DC. Plusieurs périodes le même jour sont possibles.", "it": "Nel 2024 furono introdotti i periodi di inattività versione 2, come mostrato nel nuovo portale E3/DC. Sono possibili periodi multipli dello stesso giorno.", "es": "En 2024, se introdujeron los períodos de inactividad, como se muestra en el nuevo portal E3/DC. Son posibles múltiples períodos del mismo día.", "pl": "W 2024 r. Wprowadzono okresy bezczynności w wersji 2, jak pokazano w nowym portalu E3/DC. Możliwe jest wiele okresów tego samego dnia.", "uk": "У 2024 р. Були представлені версія 2 -го періоду 2, як показано на новому порталі E3/DC. Можливі кілька періодів того ж дня.", "zh-cn": "如新的E3/DC门户网站所示，在2024年，引入了空闲时期2版。在同一天可能有多个时期。"},
